import React from 'react'
import {Col, Row} from "reactstrap";

class GroupUnit extends React.Component{
  constructor(props){
    super(props);
  }
  render() {
    return(
      <Col xs={'12'} sm={'6'} lg={'3'}>
        <Row className='pt-1 justify-content-center learning-card'>
          <Col xs="12 mt-3">
            <img
              className="rounded-circle account-circle-image"
              top
              src={this.props.imageUri}
              alt=""
            />
          </Col>
          <Col xs="12" className="account-status-text mt-4 d-flex justify-content-center">
                                          <span className={`account-status-title`}>
                                            <p className={'m-0'}>{this.props.groupName}</p>
                                          </span>
          </Col>
        </Row>
      </Col>
    );
  }
}

export default GroupUnit;
